          {" "}
          A Big <span>OFFER</span>FOR THIS SUMMER
        </h1>
        <p className="details">This is a limited time offer.</p>
        <div className="pr-btns">
          <a href="#" className="pr-btn">
            <Link to="price" smooth={true} duration={1000}>
              JOIN NOW
